class CninfoSpider(scrapy.Spider):
    name = "cninfo"

    def __init__(self, *args, **kwargs):
        super().__init__(*args, **kwargs)
        self.db = _database
        self.companies = []

    def start_requests(self):
        for company in Company.list_stock_not_checked(self.db):
            if company.name not in _stock_companies_dict:
                company.isOnStock = '0'
            else:
                company.isOnStock = '1'
                company.securityCode = _stock_companies_dict[company.name]
            company.isChekctStock = 't'
            self.db.add(company)
            self.db.commit()
        self.companies = Company.list_stock(self.db)
        yield scrapy.Request(url='http://www.cninfo.com.cn/new/index/getAnnouces?type=sz',
                             callback=self.parse_page_count, meta={'securityCodePrefix': 'SZ'})
        yield scrapy.Request(url='http://www.cninfo.com.cn/new/index/getAnnouces?type=sh',
                             callback=self.parse_page_count, meta={'securityCodePrefix': 'SH'})

    def parse_page_count(self, response):
        security_code_prefix = response.meta['securityCodePrefix']
        page_num = 1
        page_count = int(json_loads(response.body.decode('utf-8'))['totalpages'])
        page_url = self.page_url(security_code_prefix, page_num)
        if len(page_url) > 0:
            yield scrapy.Request(url=page_url, method='POST',
                                 callback=self.parse_page, meta={'securityCodePrefix': security_code_prefix, 'pageNum': page_num, 'pageCount': page_count})

    def page_url(self, security_code_prefix, page_num):
        if security_code_prefix == 'SZ':
            return 'http://www.cninfo.com.cn/new/disclosure?column={0}se_latest&pageNum={1}&pageSize=20'.format('sz', page_num)
        elif security_code_prefix == 'SH':
            return 'http://www.cninfo.com.cn/new/disclosure?column={0}se_latest&pageNum={1}&pageSize=20'.format('s', page_num)
        else:
            return ''

    def parse_page(self, response):
        security_code_prefix, page_num, page_count = response.meta['securityCodePrefix'], response.meta['pageNum'], response.meta['pageCount']
        all_announcements = json_loads(response.body.decode('utf-8'))['classifiedAnnouncements']
        for announcements in all_announcements:
            for announcement in announcements:
                security_code = '{0}{1}'.format(security_code_prefix, announcement['secCode'])
                file_url = 'http://static.cninfo.com.cn/{0}'.format(announcement['adjunctUrl'])
                if AnnouncementFile.exists(self.db, file_url):
                    continue
                company_id = None
                for company in self.companies:
                    if company.securityCode == security_code:
                        company_id = company.id
                yield AnnouncementItem(company_id=company_id, security_code=security_code, company_name=announcement['secName'],
                                       title=announcement['announcementTitle'], announcement_time=announcement['announcementTime'],
                                       source='CNINFO', file_urls=[file_url], referer='')
        if page_num < page_count:
            page_num = page_num + 1
            yield scrapy.Request(url=self.page_url(security_code_prefix, page_num), method='POST',
                                 callback=self.parse_page, meta={'securityCodePrefix': security_code_prefix, 'pageNum': page_num, 'pageCount': page_count})
